import {
  title,
  cardTitle,
  coloredShadow,
  grayColor
} from "assets/jss/material-kit-pro-react.jsx";

const sectionInterestedStyle = {
  title,
  cardTitle,
  coloredShadow,
  textCenter: {
    textAlign: "center"
  },
  section: {
    backgroundPosition: "50%",
    backgroundSize: "cover",
    padding: "70px 0"
  },
  description: {
    color: grayColor[0]
  }
};

export default sectionInterestedStyle;
